import React, { useState } from 'react';


const FindAgent = () => {
  const [activeTab, setActiveTab] = useState('Agency');

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you would implement the actual search functionality
    alert(`Searching for ${activeTab}`);
  };

  return (
    <section className="find-agent">
      <h2>FIND YOUR AGENT</h2>
      <p>They're the professionals who can help you find a home, sell your home, make an offer on a home, deal with buyers, and more.</p>
      
      {/* Tabs for switching between options */}
      <div className="tabs">
        <div 
          className={`tab ${activeTab === 'Agency' ? 'active' : ''}`} 
          onClick={() => handleTabClick('Agency')}
        >
          AGENCY
        </div>
        <div 
          className={`tab ${activeTab === 'Agent' ? 'active' : ''}`} 
          onClick={() => handleTabClick('Agent')}
        >
          AGENT
        </div>
        <div 
          className={`tab ${activeTab === 'Team' ? 'active' : ''}`} 
          onClick={() => handleTabClick('Team')}
        >
          TEAM
        </div>
      </div>

      {/* Search form */}
      <form className="search-form" onSubmit={handleSubmit}>
        <div className="form-group">
          <input 
            type="text" 
            placeholder="Pls enter Area, Town, State" 
            required 
            aria-label="Area, Town, State"
          />
        </div>
        <div className="form-group">
          <input 
            type="text" 
            placeholder={activeTab === 'Agency' ? 'Enter Name of Agency' : activeTab === 'Agent' ? 'Enter Name of Agent' : 'Enter Team Name'} 
            required 
            aria-label={activeTab === 'Agency' ? 'Name of Agency' : activeTab === 'Agent' ? 'Name of Agent' : 'Team Name'}
          />
        </div>
        <button type="submit" className="search-btn">Search Now</button>
      </form>
      
      {/* More search link */}
      <a href="#more-search" className="more-search-link">More Search</a>
    </section>
  );
};

export default FindAgent;
